PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "migrations" ("migration" varchar not null, "batch" integer not null);
CREATE TABLE "users" ("id" integer not null primary key autoincrement, "profile_id" integer not null, "name" varchar not null, "email" varchar not null, "password" varchar not null, "remember_token" varchar null, "created_at" datetime not null, "updated_at" datetime not null, "deleted_at" datetime null);
CREATE TABLE "password_resets" ("email" varchar not null, "token" varchar not null, "created_at" datetime not null);
CREATE TABLE "profiles" ("id" integer not null primary key autoincrement, "description" varchar not null, "created_at" datetime not null, "updated_at" datetime not null);
CREATE TABLE "genders" ("id" integer not null primary key autoincrement, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "states" ("id" integer not null primary key autoincrement, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "towns" ("id" integer not null primary key autoincrement, "state_id" integer not null, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("state_id") references "states"("id"), foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "parishes" ("id" integer not null primary key autoincrement, "town_id" integer not null, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("town_id") references "towns"("id"), foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "directions" ("id" integer not null primary key autoincrement, "directionable_id" integer not null, "directionable_type" varchar not null, "parish_id" integer not null, "details" varchar null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, "deleted_at" datetime null, foreign key("parish_id") references "parishes"("id"), foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "nationalities" ("id" integer not null primary key autoincrement, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "people" ("id" integer not null primary key autoincrement, "user_id" integer not null, "gender_id" integer null, "nationality_id" integer null, "first_name" varchar null, "last_name" varchar null, "first_surname" varchar null, "last_surname" varchar null, "identity_card" varchar null, "phone" varchar null, "birth_date" date null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("user_id") references "users"("id") on delete cascade, foreign key("gender_id") references "genders"("id"), foreign key("nationality_id") references "nationalities"("id"), foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "makers" ("id" integer not null primary key autoincrement, "name" varchar not null, "slug" varchar not null, "domain" varchar null, "url" varchar null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "categories" ("id" integer not null primary key autoincrement, "description" varchar not null, "info" varchar not null, "slug" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "sub_categories" ("id" integer not null primary key autoincrement, "category_id" integer not null, "description" varchar not null, "info" varchar not null, "slug" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("category_id") references "categories"("id") on delete cascade, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "products" ("id" integer not null primary key autoincrement, "user_id" integer not null, "maker_id" integer not null, "sub_category_id" integer not null, "title" varchar not null, "description" text not null, "price" float not null, "quantity" integer not null, "slug" varchar not null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, "deleted_at" datetime null, foreign key("user_id") references "users"("id") on delete cascade, foreign key("maker_id") references "makers"("id"), foreign key("sub_category_id") references "sub_categories"("id"), foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "promo_types" ("id" integer not null primary key autoincrement, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "promotions" ("id" integer not null primary key autoincrement, "promo_type_id" integer not null, "title" varchar not null, "slug" varchar not null, "percentage" integer null, "static" integer null, "begins" date not null, "ends" date not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("promo_type_id") references "promo_types"("id"), foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "product_promotion" ("product_id" integer not null, "promotion_id" integer not null, foreign key("product_id") references "products"("id") on delete cascade, foreign key("promotion_id") references "promotions"("id") on delete cascade);
CREATE TABLE "files" ("id" integer not null primary key autoincrement, "fileable_id" integer not null, "fileable_type" varchar not null, "path" varchar not null, "mime" varchar not null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "images" ("id" integer not null primary key autoincrement, "imageable_id" integer not null, "imageable_type" varchar not null, "path" varchar not null, "mime" varchar not null, "alt" varchar not null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "characteristics" ("id" integer not null primary key autoincrement, "product_id" integer not null, "height" integer null, "width" integer null, "depth" integer null, "weight" integer null, "units" integer null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, foreign key("product_id") references "products"("id") on delete cascade, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "features" ("id" integer not null primary key autoincrement, "product_id" integer not null, "title" varchar not null, "description" varchar not null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, foreign key("product_id") references "products"("id") on delete cascade, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "mechanical_infos" ("id" integer not null primary key autoincrement, "product_id" integer not null, "motor" varchar null, "motor_serial" varchar null, "model" varchar null, "cylinders" integer null, "horsepower" integer null, "mileage" integer null, "traction" integer null, "lift" integer null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, foreign key("product_id") references "products"("id") on delete cascade, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "nutritionals" ("id" integer not null primary key autoincrement, "product_id" integer not null, "due" date null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, foreign key("product_id") references "products"("id") on delete cascade, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "visits" ("id" integer not null primary key autoincrement, "user_id" integer null, "visitable_id" integer not null, "visitable_type" varchar not null, "total" integer not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("user_id") references "users"("id") on delete set null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "banks" ("id" integer not null primary key autoincrement, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "card_types" ("id" integer not null primary key autoincrement, "description" varchar not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "billings" ("id" integer not null primary key autoincrement, "user_id" integer not null, "bank_id" integer null, "card_type_id" integer null, "card_number" varchar null, "bank_account" varchar null, "expiration" varchar null, "comments" varchar null, "created_at" datetime not null, "updated_at" datetime not null, "created_by" integer not null, "updated_by" integer not null, foreign key("user_id") references "users"("id") on delete cascade, foreign key("bank_id") references "banks"("id"), foreign key("card_type_id") references "card_types"("id"), foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "maker_sub_category" ("maker_id" integer not null, "sub_category_id" integer not null, foreign key("maker_id") references "makers"("id"), foreign key("sub_category_id") references "sub_categories"("id"));
CREATE TABLE "product_user" ("product_id" integer not null, "user_id" integer not null, "quantity" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("product_id") references "products"("id") on delete cascade, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE "map_details" ("id" integer not null primary key autoincrement, "direction_id" integer not null, "latitude" float not null, "longitude" float not null, "zoom" integer not null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("direction_id") references "directions"("id") on delete cascade, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "user_confirmations" ("id" integer not null primary key autoincrement, "user_id" integer not null, "data" varchar null, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE "providers" ("id" integer not null primary key autoincrement, "name" varchar not null, "slug" varchar not null, "url" varchar null, "contact_name" varchar null, "contact_title" varchar null, "contact_email" varchar null, "contact_phone_1" varchar null, "contact_phone_2" varchar null, "contact_phone_3" varchar null, "contact_phone_4" varchar null, "email" varchar null, "phone_1" varchar null, "phone_2" varchar null, "phone_3" varchar null, "phone_4" varchar null, "trust" varchar null, "created_by" integer not null, "updated_by" integer not null, "created_at" datetime not null, "updated_at" datetime not null, foreign key("created_by") references "users"("id"), foreign key("updated_by") references "users"("id"));
CREATE TABLE "product_provider" ("product_id" integer not null, "provider_id" integer not null, "sku" varchar null, foreign key("product_id") references "products"("id") on delete cascade, foreign key("provider_id") references "providers"("id"));
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX users_name_unique on "users" ("name");
CREATE UNIQUE INDEX users_email_unique on "users" ("email");
CREATE INDEX password_resets_email_index on "password_resets" ("email");
CREATE INDEX password_resets_token_index on "password_resets" ("token");
CREATE UNIQUE INDEX profiles_description_unique on "profiles" ("description");
CREATE UNIQUE INDEX genders_description_unique on "genders" ("description");
CREATE UNIQUE INDEX states_description_unique on "states" ("description");
CREATE UNIQUE INDEX nationalities_description_unique on "nationalities" ("description");
CREATE UNIQUE INDEX people_identity_card_unique on "people" ("identity_card");
CREATE UNIQUE INDEX makers_name_unique on "makers" ("name");
CREATE UNIQUE INDEX categories_description_unique on "categories" ("description");
CREATE UNIQUE INDEX sub_categories_description_unique on "sub_categories" ("description");
CREATE UNIQUE INDEX promo_types_description_unique on "promo_types" ("description");
CREATE UNIQUE INDEX banks_description_unique on "banks" ("description");
CREATE UNIQUE INDEX card_types_description_unique on "card_types" ("description");
CREATE INDEX product_user_product_id_index on "product_user" ("product_id");
CREATE INDEX product_user_user_id_index on "product_user" ("user_id");
CREATE INDEX user_confirmations_user_id_index on "user_confirmations" ("user_id");
CREATE UNIQUE INDEX providers_name_unique on "providers" ("name");
COMMIT;
